DROP SCHEMA

IF EXISTS residu;
	CREATE SCHEMA residu COLLATE = utf8_general_ci;

USE residu;



-- Inicialment s'esborren totes les taules



CREATE TABLE EmpresaProductora (
	nif_empresa varchar (12) NOT NULL,
	nom_empresa varchar (80) NOT NULL,
	ciutat_empresa varchar (20),
	activitat varchar (200),
	aa_empresa LONG,
		CONSTRAINT pk_emp PRIMARY KEY (nif_empresa),
		CONSTRAINT ck_emp CHECK (nif_empresa= UPPER (nif_empresa)));

CREATE TABLE Residu (
	nif_empresa varchar (12) NOT NULL,
	cod_residu numeric (6) NOT NULL,
	toxicitat numeric (6),
	quantitat_residu numeric (6),
	aa_residu LONG,
		CONSTRAINT pk_res PRIMARY KEY (nif_empresa, cod_residu),
		CONSTRAINT fk_res_emp FOREIGN KEY (nif_empresa) REFERENCES EmpresaProductora (nif_empresa) ON DELETE CASCADE,
		CONSTRAINT ck_res CHECK (cod_residu >=0), 
		CONSTRAINT ck_ctd CHECK (quantitat_residu > 0));

CREATE TABLE Constituent (
	cod_constituent numeric (6) NOT NULL,
	nom_constituent varchar (60) NOT NULL,
	aa_constituent LONG,
	activitat varchar (200),
		CONSTRAINT pk_con PRIMARY KEY (cod_constituent),
		CONSTRAINT ck_cod CHECK (cod_constituent >= 0));

CREATE TABLE Residu_constituent (
	nif_empresa varchar (12) NOT NULL,
	cod_residu numeric (6) NOT NULL,
	cod_constituent numeric (6) NOT NULL,
	quantitat numeric (6),
		CONSTRAINT pk_rec PRIMARY KEY (nif_empresa, cod_residu, cod_constituent),
		CONSTRAINT fk_rec_res FOREIGN KEY (nif_empresa, cod_residu) REFERENCES Residu (nif_empresa, cod_residu) ON DELETE CASCADE,
		CONSTRAINT fk_rec_con FOREIGN KEY (cod_constituent) REFERENCES Constituent(cod_constituent) ON DELETE CASCADE,
		CONSTRAINT ck_cant CHECK (quantitat > 0));

CREATE TABLE EmpresaTransportista (
	nif_emptransport varchar (12) NOT NULL,
	nom_emptransport varchar (120) NOT NULL,
	ciutat_emptransport varchar (30),
	aa_emptransport LONG,
		CONSTRAINT pk_tra PRIMARY KEY (nif_emptransport),
		CONSTRAINT ck_tra CHECK (nif_emptransport = UPPER(nif_emptransport)));

CREATE TABLE Desti (
	cod_desti varchar (12) NOT NULL,
	nom_desti varchar (20) NOT NULL,
	ciutat_desti varchar (20),
	aa_desti LONG,
		CONSTRAINT pk_des PRIMARY KEY (cod_desti),
		CONSTRAINT ck_des CHECK (cod_desti = UPPER(cod_desti)));

CREATE TABLE Trasllat (
	nif_empresa varchar (12) NOT NULL,
	cod_residu numeric (6) NOT NULL,
	data_enviament DATE NOT NULL,
	cod_desti varchar (12) NOT NULL,
	envas varchar(10),
	data_arribada DATE,
	tractament varchar(120),
	quantitat_trasllat numeric(6),
	aa_trasllat LONG,
		CONSTRAINT pk_trl PRIMARY KEY (nif_empresa, cod_residu, data_enviament, cod_desti),
		CONSTRAINT fk_trl_res FOREIGN KEY (nif_empresa, cod_residu) REFERENCES Residu(nif_empresa, cod_residu) on delete cascade,
		CONSTRAINT fk_trl_des FOREIGN KEY (cod_desti) REFERENCES Desti (cod_desti),
		CONSTRAINT ck_quant CHECK (quantitat_trasllat > 0));

CREATE TABLE Trasllat_EmpresaTransport (
	nif_empresa varchar (12) NOT NULL,
	cod_residu numeric (6) NOT NULL,
	data_enviament DATE NOT NULL,
	cod_desti varchar (12) NOT NULL,
	nif_emptransport varchar (12) NOT NULL,
	tipus_transport varchar(15),
	kms numeric (4),
	cost numeric (5),
		CONSTRAINT pk_tet PRIMARY KEY (nif_empresa, cod_residu, data_enviament, cod_desti, nif_emptransport),
		CONSTRAINT fk_tet_trl FOREIGN KEY (nif_empresa, cod_residu, data_enviament, cod_desti) REFERENCES Trasllat (nif_empresa, cod_residu, data_enviament, cod_desti) ON DELETE CASCADE,
		CONSTRAINT fk_tet_tra FOREIGN KEY (nif_emptransport) REFERENCES EmpresaTransportista (nif_emptransport),
		CONSTRAINT ck_cos CHECK (cost >= 0),
		CONSTRAINT ck_kms CHECK (kms > 0));


